import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      datas: []
    }
  }


  componentDidMount() {
    fetch('https://gist.githubusercontent.com/Salaidevaganamani/506b059aa029b018e04a8e88f2cfce83/raw/5a518ac78070d805a63061767bafc858965b71fe/dummy.json')
    .then((response) => {
      return response.json();
    })
    .then((myJs) => {
      const values = JSON.stringify(myJs);
      this.setState({datas: values});
      console.log(this.state.datas);
    })
  }

  render() {
    const datas = this.state.datas;
    return (
      <div className="App">
        <p>Salai Deva</p>
        {
          datas.map(item => (
            <div>
              <ul>
                <li>{item.name}</li>
              </ul>
            </div>
          ))
        }

      </div>
    );
  }
}

export default App;
